import axios from 'axios'
import {
    BrowserRouter as Router,
    Routes, Route, Link, Navigate
} from 'react-router-dom'
import {ProSidebarProvider} from 'react-pro-sidebar'
import './index.css'
import { useState, useEffect } from 'react'

import exerciseServices from './services/exercises'
import workoutServices from './services/workouts'

import Home from './components/Home'
import LoginForm from './components/LoginForm'
import UserSidebar from './components/UserSidebar'
import RegistrationPage from './components/RegistrationPage'
import WorkoutHistoryPage from './components/WorkoutHistoryPage'

const App = () => {
    /* App state variables and updater functions */
    const [errorMessage, setErrorMessage] = useState([])    
    const [username, setUsername, password, setPassword] = useState('')
    const [user, setUser] = useState(null)
    const [loggedIn, setLoggedIn] = useState(false)

    /* Gets logged-in user and token from localStorage if available */
    useEffect(() => {
	const loggedUserJSON = window.localStorage.getItem('loggedFitnessAppUser')
	if (loggedUserJSON) {
	    const user = JSON.parse(loggedUserJSON)
	    setUser(user)
	    workoutServices.setToken(user.token)
	}
    }, [])

    /* Error notification */
    const Notification = ({message}) => {
	if (message === null) {
	    return null
	}
	return (
		<div className='error'> {message} </div>
	)
    }

    const UserPage = ({loggedIn, setLoggedIn}) => {

	/* UserPage state variables and updater functions */
	const [exercises, setExercises] = useState([])
	const [workout, setWorkout] = useState({})
	const [currSets, setCurrSets] = useState(0)
	const [currReps, setCurrReps] = useState(0)
	const [openDropdown, setOpenDropdown] = useState(false)

	/* Gets all of the exercises from the backend */
	useEffect(() => {
	    exerciseServices
		.getAll()
		.then(exercises => {
		    setExercises(exercises)
		})
        }, [])

        const handleSetChange = (event) => {	
	    setCurrSets(event.target.value)
        }

        const handleRepChange = (event) => {
	    setCurrReps(event.target.value)
        }

    const addCluster = (event) => {
	event.preventDefault()
	const exercise = event.target.elements.exercises.value
	const sets = event.target.elements.sets.value
	const reps = event.target.elements.reps.value
	console.log(`exercise name ${exercise} sets ${sets} reps ${reps}`)
	const newCluster = {'exercise': exercise, 'sets': sets, 'reps': reps}

	if (Object.keys(workout).length === 0) {
	    console.log('new workout')
	    workoutServices
		.create(newCluster)
		.then(createdWorkout => {
		    console.log(createdWorkout)
		    setWorkout({...createdWorkout})
		    console.log(workout.clusters)
	 	})	    
	 } else {
	    console.log('existing workout')
	    const updatedWorkout = {...workout, clusters: workout.clusters.concat(newCluster)}

	    workoutServices
		.update(workout.id, updatedWorkout)
		 .then(updatedWorkout => {
		     console.log(updatedWorkout)
		    setWorkout(updatedWorkout)
		})
	}
    }

	const listClusters = () => {
	    console.log(`list clusters ${workout}`)	    
	    if (Object.keys(workout).length === 0) {
		console.log('empty')
		return <label htmlFor="noClustersPrompt"> Add your first exercise for this workout! </label>
	    } else {
		console.log('workout')
		return workout.clusters.map(cluster =>
		    <li>
		    <label htmlFor="exercise"> {cluster.exercise.name} </label>
		    <label htmlFor="sets"> {cluster.sets} </label>
		    <label htmlFor="reps"> {cluster.reps} </label>
		   </li>
		)
	    }
	}

	return (
		<div className="user-main">
		<UserSidebar setLoggedIn={setLoggedIn}/>
		<div className="user-log">
		<h1> Fitness Tracking App </h1>	
		<Notification message={errorMessage}/>
		<div>
	        <h2> Exercises Done Today </h2>	
		<ul> {listClusters()} </ul>
		</div>
		<form onSubmit={addCluster}>		
	        <div>
		    <select name="exercises" id="exercises">
	                {exercises.map(exercise => <option value={exercise.name}>{exercise.name}</option>)}
	            </select>		

		    <label htmlFor="sets"> Sets </label>
		    <input id="sets" type="text" value={currSets} onChange={handleSetChange}/>

		    <label htmlFor="reps"> Reps </label>
	            <input id="reps" type="text" value={currReps} onChange={handleRepChange} />
		    <button type="submit"> Add </button>
	        </div>
		</form>		
		</div>
		</div>
        )	
    }

    return (
	<div>
	    <Router>
	        <div>
	            <Link to="/">Home</Link>
	            <Link to="/user">User</Link>
	        </div>
	    <Routes>
	        <Route exact path="/" element={
		    !loggedIn ? (<Home loggedIn={loggedIn} setLoggedIn={setLoggedIn}
		    user={user} setUser={setUser} />) : (
	            <Navigate replace to={"/user"} />
	            )
                }
                /> 
	    <Route path="/user" element={
		    <ProSidebarProvider> <UserPage setLoggedIn={setLoggedIn} /> </ProSidebarProvider>
	    }/>
	    <Route path="/register" element={<RegistrationPage />}/>
	    <Route path="/workout-history" element={
		    <ProSidebarProvider> <WorkoutHistoryPage setLoggedIn={setLoggedIn} /> </ProSidebarProvider>
	    }/>
	    </Routes>
	    </Router>
	    </div>
    )
}

export default App
